import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import Sdata from './Sdata';

const ncard = (val) => {
    return (
        <Card 
            imgsrc={val.imgsrc}
            title={val.title}
            sname = {val.sname}
            link={val.link}
        />
    );
}
ReactDOM.render(
   <>
    <h1 className="heading_style" >List of top 5 Netflix Series</h1>
     {Sdata.map(ncard)}
   </>,
   document.getElementById('root')
);
